entor and it can be changed on the fly.It allows, for instance, to switch the implementor base on the operative system where Squeak is being started.!VideoDeviceImplementor subclass: #TestDeviceImplementor	instanceVariableNames: 'opened extent type isShowingTime'	classVariableNames: ''	poolDictionaries: ''	category: 'VideoForSqueak-Core'!VideoDeviceImplementor subclass: #V4LDeviceImplementor	instanceVariableNames: 'deviceHandle buffer deviceID desiredExtent desiredPalette'	classVariableNames: ''	poolDictionaries: ''	category: 'VideoForSqueak-Core'!Object subclass: #VideoDeviceImplementorDescription	instanceVariableNames: 'type id name'	classVariableNames: ''	poolDictionaries: ''	category: 'VideoForSqueak-Core'!RectangleMorph subclass: #VideoMorph	instanceVariableNames: 'videoSource form resolution autoExtent configurationDialog'	classVariableNames: ''	poolDictionaries: ''	category: 'VideoForSqueak-Morphic'!AlignmentMorph subclass: #VideoMorphConfiguration	instanceVariableNames: 'target parameters'	classVariableNames: ''	poolDictionaries: ''	category: 'VideoForSqueak-Morphic'!ObjectPropertiesMorph subclass: #VideoPropertiesMorph	instanceVariableNames: ''	classVariableNames: ''	poolDictionaries: ''	category: 'VideoForSqueak-Morphic'!!ImageResolutionType methodsFor: 'initialization' stamp: 'dgd 7/1/2004 13:30'!initialize	"initialize the receiver's"	super initialize.	""	self vocabularyName: #ImageResolution.	self symbols: VideoMorph resolutions! !!ImageResolutionType methodsFor: 'tiles' stamp: 'dgd 8/20/2006 11:30'!representsAType	^ true! !!ImageResolutionType class methodsFor: 'class initialization' stamp: 'dgd 8/20/2006 11:44'!initialize	Vocabulary initialize! !!ParameterDescription methodsFor: 'creation' stamp: 'dgd 8/10/2004 14:17'!asBooleanMorph	| cb lab |	cb := EtoyUpdatingThreePhaseButtonMorph checkBox.	cb		target: self;		actionSelector: #switchValue;		getSelector: #value.	help isEmpty ifFalse: [cb setBalloonText: help].	""	lab := StringMorph contents: ' ' , label.	lab setBalloonText: help.	help isEmpty ifFalse: [lab setBalloonText: help].	""	^self inARow: { 				cb.				lab}! !!ParameterDescription methodsFor: 'creation' stamp: 'dgd 8/10/2004 12:36'!asExtentMorph	| lab x y kr |	lab := StringMorph contents: label , ': '.	help isEmpty		ifFalse: [lab setBalloonText: help].	""	x := UpdatingNumericStringMorph on: self selector: #getPointX.	x putSelector: #setPointX:.	x min: 16.	x max: 640.	x setBalloonText: 'width in pixels' translated.	""	y := UpdatingNumericStringMorph on: self selector: #getPointY.	y putSelector: #setPointY:.	y min: 12.	y max: 480.	y setBalloonText: 'height in pixels' translated.	""	kr := EtoyUpdatingThreePhaseButtonMorph checkBox.	kr target: self;		 actionSelector: #switchKeepRatio;		 getSelector: #keepRatio.	kr setBalloonText: 'keep ratio' translated.	""	^ self inARow: {lab. StringMorph contents: ' width=' translated. self inABox: x. StringMorph contents: ' height=' translated. self inABox: y. StringMorph contents: '  '. kr}! !!ParameterDescription methodsFor: 'creation' stamp: 'dgd 8/10/2004 12:06'!asMorph	type == #boolean		ifTrue: [^ self asBooleanMorph].	type == #extent		ifTrue: [^ self asExtentMorph].	type == #option		ifTrue: [^ self asOptionMorph].	""	^ StringMorph contents: 'unknown type: ' , type asString! !!ParameterDescription methodsFor: 'creation' stamp: 'dgd 8/10/2004 12:33'!asOptionMorph	| lab button |	lab := StringMorph contents: label , ': '.	help isEmpty		ifFalse: [lab setBalloonText: help].	""	button := UpdatingSimpleButtonMorph newWithLabel: '-'.	button target: self;		 wordingSelector: #wordingForOption;		 actionSelector: #showOptions;		 color: Color white;		 borderWidth: 1;		 borderColor: Color black;		 cornerStyle: #square.help isEmpty		ifFalse: [button setBalloonText: help].	""	^ self inARow: {lab. button}! !!ParameterDescription methodsFor: 'private' stamp: 'dgd 8/10/2004 14:17'!getPointX	^(self value) x! !!ParameterDescription methodsFor: 'private' stamp: 'dgd 8/10/2004 14:17'!getPointY	^(self value) y! !!ParameterDescription methodsFor: 'private' stamp: 'dgd 8/9/2004 19:10'!inABox: aMorph 	"private - answer a row with the given morphs"	| box |	box := AlignmentMorph newRow.	box color: Color white.	box borderWidth: 1.	box borderColor: Color black.	""	box addMorphBack: aMorph.	""	^ box! !!ParameterDescription methodsFor: 'private' stamp: 'dgd 8/9/2004 17:38'!inARow: aCollection 	"private - answer a row with the given morphs"	| row |	row := AlignmentMorph newRow.	row color: Color transparent.	""	aCollection		do: [:each | row addMorphBack: each].	""	^ row! !!ParameterDescription methodsFor: 'private' stamp: 'dgd 8/10/2004 14:17'!setPointX: aNumber 	| newX currentX newY |	newX := aNumber asInteger min: 640 max: 16.	currentX := self getPointX.	newX = currentX ifTrue: [^self].	newY := keepRatio 				ifTrue: [(newX / currentX * self getPointY) rounded]				ifFalse: [self getPointY].	""	self value: newX @ newY! !!ParameterDescription methodsFor: 'private' stamp: 'dgd 8/10/2004 14:17'!setPointY: aNumber 	| newY currentY newX |	newY := aNumber asInteger min: 480 max: 12.	currentY := self getPointY.	newY = currentY ifTrue: [^self].	newX := keepRatio 				ifTrue: [(newY / currentY * self getPointX) rounded]				ifFalse: [self getPointX].	""	self value: newX @ newY! !!ParameterDescription methodsFor: 'private' stamp: 'dgd 8/10/2004 14:17'!showOptions	| menu |	menu := MenuMorph new.	menu color: Color white.	menu borderWidth: 1.	menu borderColor: Color black.	menu cornerStyle: #square.	options do: 			[:pair | 			""			menu 				add: pair first				target: self				selector: #value:				argumentList: { 						pair second}].	menu popUpInWorld! !!ParameterDescription methodsFor: 'private' stamp: 'dgd 8/10/2004 14:18'!wordingForOption	| option wording |	option := self value.	wording := options detect: [:pair | pair second = option]				ifNone: [^'<unknown option>' translated].	^wording first! !!ParameterDescription methodsFor: 'accessing' stamp: 'dgd 8/10/2004 20:14'!hasChanged	^ value ~= originalValue! !!ParameterDescription methodsFor: 'accessing' stamp: 'dgd 8/9/2004 20:23'!keepRatio	^keepRatio! !!ParameterDescription methodsFor: 'accessing' stamp: 'dgd 8/10/2004 20:09'!name	"answer the receiver's name"	^ name! !!ParameterDescription methodsFor: 'accessing' stamp: 'dgd 8/9/2004 20:24'!switchKeepRatio	keepRatio := keepRatio not! !!ParameterDescription methodsFor: 'accessing' stamp: 'dgd 8/10/2004 14:18'!switchValue	value := value not ! !!ParameterDescription methodsFor: 'accessing' stamp: 'dgd 8/10/2004 14:13'!value^value! !!ParameterDescription methodsFor: 'accessing' stamp: 'dgd 8/10/2004 14:13'!value: anObject	value _anObject! !!ParameterDescription methodsFor: 'initialization' stamp: 'dgd 8/9/2004 20:23'!initialize	"initialize the receiver"	keepRatio := true! !!ParameterDescription methodsFor: 'initialization' stamp: 'dgd 8/10/2004 20:09'!initializeName: nameSymbol type: typeSymbol label: labelString value: anObject options: aCollection help: helpString 	"initialize the receiver"	name := nameSymbol.	type := typeSymbol.	label := labelString.	value := originalValue := anObject.	options := aCollection.	help := helpString! !!ParameterDescription class methodsFor: 'instance creation' stamp: 'dgd 8/10/2004 20:10'!booleanParameterNamed: nameSymbol label: labelString value: anObject help: helpString 	^ self new		initializeName: nameSymbol 		type: #boolean		label: labelString		value: anObject		options: nil		help: helpString! !!ParameterDescription class methodsFor: 'instance creation' stamp: 'dgd 8/10/2004 20:11'!extentParameterNamed: nameSymbol label: labelString value: anObject help: helpString 	^ self new		initializeName: nameSymbol		type: #extent		label: labelString		value: anObject		options: nil		help: helpString! !!ParameterDescription class methodsFor: 'instance creation' stamp: 'dgd 8/9/2004 20:13'!new	"answer a new instance of the receiver"	^ super new initialize! !!ParameterDescription class methodsFor: 'instance creation' stamp: 'dgd 8/10/2004 20:12'!optionParameterNamed: nameSymbol label: labelString value: anObject options: aCollection help: helpString 	^ self new		initializeName: nameSymbol		type: #option		label: labelString		value: anObject		options: aCollection		help: helpString! !!Player methodsFor: '*VideoForSqueak-playing commands' stamp: 'dgd 8/9/2004 20:56'!configureVideoDevice	self sendMessageToCostume: #configureVideoDevice! !!Player methodsFor: '*VideoForSqueak-slot getters/setters' stamp: 'dgd 8/6/2004 19:54'!getAutoExtent	"answer whateve the receiver is in auto extent mode"	^ costume renderedMorph getAutoExtent! !!Player methodsFor: '*VideoForSqueak-slot getters/setters' stamp: 'dgd 6/30/2004 23:21'!getBrightness	"Answer the numeric value contained in my costume"	^ costume renderedMorph getBrightness! !!Player methodsFor: '*VideoForSqueak-slot getters/setters' stamp: 'dgd 6/30/2004 23:21'!getContrast	"Answer the numeric value contained in my costume"	^ costume renderedMorph getContrast! !!Player methodsFor: '*VideoForSqueak-slot getters/setters' stamp: 'dgd 7/1/2004 18:24'!getLastFrame	"Answer the lastFrame in my costume"	^ costume renderedMorph getLastFrame assuredPlayer! !!Player methodsFor: '*VideoForSqueak-slot getters/setters' stamp: 'dgd 7/1/2004 13:23'!getResolution	"Answer the numeric value contained in my costume"	^ costume renderedMorph getResolution! !!Player methodsFor: '*VideoForSqueak-slot getters/setters' stamp: 'dgd 8/6/2004 19:55'!setAutoExtent: aBoolean 	"Set the receiver's boolean value. This is passed on to the costume"	costume renderedMorph setAutoExtent: aBoolean! !!Player methodsFor: '*VideoForSqueak-slot getters/setters' stamp: 'dgd 6/30/2004 23:22'!setBrightness: amt 	"Set the receiver's numeric value to the amount. This is passed 	on to the costume"	costume renderedMorph setBrightness: amt! !!Player methodsFor: '*VideoForSqueak-slot getters/setters' stamp: 'dgd 6/30/2004 23:22'!setContrast: amt 	"Set the receiver's numeric value to the amount. This is passed 	on to the costume"	costume renderedMorph setContrast: amt! !!Player methodsFor: '*VideoForSqueak-slot getters/setters' stamp: 'dgd 7/1/2004 13:22'!setResolution: aSymbol 	"Set the receiver's value. This is passed on to the costume"	costume renderedMorph setResolution: aSymbol! !!UpdatingNumericStringMorph methodsFor: 'target access' stamp: 'sw 9/13/2002 17:54'!acceptValueFromTarget: v	"Accept a value from my target"	^ super acceptValueFromTarget: ((self format == #default and: [v isNumber])		ifTrue: 			[| t | 			t _ v.			min ifNotNil: [t _ t max: min].			max ifNotNil: [t _ t min: max]]		ifFalse:			[v])! !!UpdatingNumericStringMorph methodsFor: 'accessing' stamp: 'NS 6/24/2000 16:31'!max	^ max! !!UpdatingNumericStringMorph methodsFor: 'accessing' stamp: 'NS 6/24/2000 16:31'!max: aNumber	max _ aNumber! !!UpdatingNumericStringMorph methodsFor: 'accessing' stamp: 'NS 6/24/2000 16:32'!min	^ min! !!UpdatingNumericStringMorph methodsFor: 'accessing' stamp: 'NS 6/24/2000 16:31'!min: aNumber	min _ aNumber! !!V4LPlugin methodsFor: 'primitives' stamp: 'dgd 8/1/2004 20:41'!primitiveDeviceClose	| device |	self export: true. 	self var: #device type: 'Device'.	device := self				cCoerce: (interpreterProxy stackIntegerValue: 0)				to: 'Device'.	self closeDevice: device.	""	interpreterProxy pop: 1! !!V4LPlugin methodsFor: 'primitives' stamp: 'dgd 8/5/2004 22:27'!primitiveDeviceCreate	| palette height width devicePointer deviceID |	self export: true.	""	palette := interpreterProxy stackIntegerValue: 0.	height := interpreterProxy stackIntegerValue: 1.	width := interpreterProxy stackIntegerValue: 2.	deviceID := interpreterProxy stackIntegerValue: 3.	""	devicePointer := self cCode: '(int) createDevice(deviceID, width, height, palette)'.	devicePointer <= 0		ifTrue: [^ interpreterProxy primitiveFail].	""	interpreterProxy		pop: 5		thenPush: (interpreterProxy integerObjectOf: devicePointer) ! !!V4LPlugin methodsFor: 'primitives' stamp: 'dgd 7/29/2004 17:49'!primitiveDeviceDescribe	| deviceID deviceName deviceNamePointer deviceNameSize |	self export: true.	self var: #deviceNamePointer type: 'void*'.	""	deviceName := interpreterProxy stackValue: 0.	(interpreterProxy isBytes: deviceName)		ifFalse: [^ interpreterProxy primitiveFail].	deviceNamePointer := interpreterProxy firstIndexableField: deviceName.	deviceNameSize := interpreterProxy byteSizeOf: deviceName.	deviceNameSize = 32		ifFalse: [^ interpreterProxy primitiveFail].	""	deviceID := interpreterProxy stackIntegerValue: 1.	""	self cCode: 'describeDevice(deviceID, deviceNamePointer)'.	"" 	interpreterProxy pop: 2! !!V4LPlugin methodsFor: 'primitives' stamp: 'dgd 7/21/2004 17:43'!primitiveDeviceGetHeight	| device result |	self export: true.	self var: #device type: 'Device'.	device := self				cCoerce: (interpreterProxy stackIntegerValue: 0)				to: 'Device'.	result := self cCode: 'device->vwindow.height'.	interpreterProxy		pop: 2		thenPush: (interpreterProxy integerObjectOf: result)! !!V4LPlugin methodsFor: 'primitives' stamp: 'dgd 7/21/2004 17:48'!primitiveDeviceGetWidth	| device result |	self export: true.	self var: #device type: 'Device'.	device := self				cCoerce: (interpreterProxy stackIntegerValue: 0)				to: 'Device'.	result := self cCode: 'device->vwindow.width'.	interpreterProxy		pop: 2		thenPush: (interpreterProxy integerObjectOf: result)! !!V4LPlugin methodsFor: 'primitives' stamp: 'dgd 8/6/2004 14:32'!primitiveDeviceNextFrameIntoBrightnessAndContrast	"set the capture extent and pixel format to use"	| contrast brightness bitsArrayPointer bitsArraySize device result dest src imageSize final |	self export: true.	self var: #device type: 'Device'.	self var: #dest type: 'unsigned char*'.	self var: #src type: 'unsigned char*'.	self var: #final type: 'unsigned char*'.	self var: #brightness type: 'double'.	self var: #contrast type: 'double'.	""	contrast := interpreterProxy stackFloatValue: 0.	brightness := interpreterProxy stackFloatValue: 1.	brightness := brightness min: 1.0.	brightness := brightness max: -1.0.	contrast := contrast min: 1.0.	contrast := contrast max: -1.0. 	""	bitsArrayPointer := interpreterProxy stackValue: 2.	interpreterProxy success: (interpreterProxy isPointers: bitsArrayPointer) not.	interpreterProxy failed		ifTrue: [^ nil].	bitsArraySize := interpreterProxy byteSizeOf: bitsArrayPointer.	""	device := self				cCoerce: (interpreterProxy stackIntegerValue: 3)				to: 'Device'.	""	result := self nextFrameFromDevice: device.	result		ifFalse: [^ interpreterProxy primitiveFail].	""	dest := self				cCoerce: (interpreterProxy firstIndexableField: bitsArrayPointer)				to: 'unsigned char*'.	src := self cCode: 'device->buffer24'.	""	imageSize := device width * device height * 4.	final := dest				+ (imageSize min: bitsArraySize).	""	[dest < final]		whileTrue: [| blue green red | 			"blue"			blue := self						pixel: (src at: 2)						brightness: brightness						contrast: contrast.			dest at: 0 put: blue.			"green"			green := self						pixel: (src at: 1)						brightness: brightness						contrast: contrast.			dest at: 1 put: green.			"red"			red := self						pixel: (src at: 0)						brightness: brightness						contrast: contrast.			dest at: 2 put: red.			"alpha"			dest at: 3 put: 255.			""			dest := dest + 4.			src := src + 3].	""	interpreterProxy pop: 4! !!V4LPlugin methodsFor: 'helper functions' stamp: 'dgd 8/5/2004 22:51'!height: device 	self inline: true.	self var: #device type: 'Device'.	^ self cCode: 'device->vwindow.height'! !!V4LPlugin methodsFor: 'helper functions' stamp: 'dgd 8/20/2006 10:45'!pixel: pixel brightness: brightness contrast: contrast 	| result c |	self inline: true.	self var: #brightness type: 'double'.	self var: #contrast type: 'double'.	self var: #c type: 'double'.	"contrast"	c := 1.0 + contrast.	c := c * c.	result := pixel - 0.5 * c + 0.5.	"brightness"	result := result + (brightness * 256) asInteger.	"bound checking"	result < 0		ifTrue: [result := 0].	result > 255		ifTrue: [result := 255].	^ result asInteger! !!V4LPlugin methodsFor: 'helper functions' stamp: 'dgd 7/21/2004 21:02'!width: device 	self inline: true.	self var: #device type: 'Device'.	^ self		cCode: 'device->vwindow.width'	! !!V4LPlugin class methodsFor: 'translation' stamp: 'dgd 6/26/2004 18:12'!hasHeaderFile	"If there is a single intrinsic header file to be associated with 	the plugin, here is where you want to flag"	^ true! !!V4LPlugin class methodsFor: 'translation' stamp: 'dgd 8/5/2004 22:50'!translate	" 	V4LPlugin translate.	"	| directory |	directory := FileDirectory forFileName: '/home/dgd/squeak-vm37/src/plugins/V4LPlugin/'.	directory assureExistence.	self translateInDirectory: directory doInlining: true! !!VideoDevice methodsFor: 'private' stamp: 'dgd 7/11/2004 20:50'!benchmark	"capture and display 100 frames from the device"	| iterations time statistics |	iterations := 100.	time := Time				millisecondsToRun: [""					iterations						timesRepeat: [self next display]].	""	Display restore.	""	statistics := String new writeStream.	statistics nextPutAll: '------------------------------------------------------------'.	statistics cr.	statistics nextPutAll: 'Frame Extent: ' , self extent asString.	statistics cr.	statistics nextPutAll: 'Iterations: ' , iterations asString.	statistics cr.	statistics nextPutAll: 'Ellapsed time:' , time asString , 'ms (each ' , (time / iterations) asFloat rounded asString , 'ms)'.	statistics cr.	statistics nextPutAll: 'Frames per second:' , (1000.0 / (time / iterations) roundTo: 0.01) asString.	statistics cr.	statistics nextPutAll: '------------------------------------------------------------'.	statistics cr.	""	statistics contents openInWorkspaceWithTitle: 'benchmark'! !!VideoDevice methodsFor: 'private' stamp: 'dgd 8/9/2004 19:44'!changedExtentself triggerEvent:#extent! !!VideoDevice methodsFor: 'private' stamp: 'dgd 8/1/2004 13:08'!closedFrame	"private"	^ self frameColor: Color blue twiceDarker withMessage: 'closed' translated! !!VideoDevice methodsFor: 'private' stamp: 'dgd 8/1/2004 12:49'!frameColor: aColor withMessage: aString 	"private - create a frame of the given color with aString as the message"	| result |	result := Form extent: self extent depth: 32.	result fillColor: aColor.	result getCanvas		drawString: aString		at: 5 @ 2		font: Preferences windowTitleFont		color: Color lightGreen.	^ result! !!VideoDevice methodsFor: 'private' stamp: 'dgd 8/1/2004 20:47'!poisonedFrame	"private"	^ self		frameColor: Color red muchDarker		withMessage: ('no connected video device id: {1}' translated format: {self deviceID})! !!VideoDevice methodsFor: 'accessing' stamp: 'dgd 7/11/2004 20:55'!brightness	"answer the receiver's brightness"	^ brightness! !!VideoDevice methodsFor: 'accessing' stamp: 'dgd 7/28/2004 17:08'!brightness: aNumber 	"change the receiver's brightness"		brightness := aNumber asFloat min: 1.0 max: -1.0! !!VideoDevice methodsFor: 'accessing' stamp: 'dgd 7/11/2004 20:55'!contrast	"answer the receiver's contrast"	^ contrast! !!VideoDevice methodsFor: 'accessing' stamp: 'dgd 7/28/2004 17:08'!contrast: aNumber 	"change the receiver's contrast"		contrast := aNumber asFloat min: 1.0 max: -1.0! !!VideoDevice methodsFor: 'accessing' stamp: 'dgd 7/28/2004 20:20'!deviceID	"answer the receiver's deviceID"	^ implementation deviceID! !!VideoDevice methodsFor: 'accessing' stamp: 'dgd 7/28/2004 20:19'!extent	"answer the receiver's extent"	^implementation extent! !!VideoDevice methodsFor: 'dying / reviving' stamp: 'dgd 8/1/2004 20:16'!bePoisoned	"change the receiver to be poisoned"	lastErrorTimestamp := Time millisecondClockValue.	[self closeIfCorresponds]		on: Error		do: [:exception | ]! !!VideoDevice methodsFor: 'dying / reviving' stamp: 'dgd 8/1/2004 19:59'!isPoisoned	"answer whatever the receiver is poisoned"	^ lastErrorTimestamp notNil! !!VideoDevice methodsFor: 'dying / reviving' stamp: 'dgd 8/1/2004 20:51'!isTimeToRevive	"answer if it's time to try to revive the receiver"	| elapsed |	self isPoisoned		ifFalse: [^ false].	elapsed := Time millisecondsSince: lastErrorTimestamp.	^ elapsed > 5000! !!VideoDevice methodsFor: 'dying / reviving' stamp: 'dgd 8/1/2004 20:51'!tryToRevive	"private - trying to revive the receiver"	self flag: #todo.	"try to connect to another device if the current deviceID is  	unavailable."	""	lastErrorTimestamp := nil.	self open! !!VideoDevice methodsFor: 'dying / reviving' stamp: 'dgd 8/1/2004 20:12'!tryToReviveIfCorresponds	"private - try to revive if it's time to"	self isTimeToRevive		ifTrue:[	self tryToRevive]! !!VideoDevice methodsFor: 'opening / closing' stamp: 'dgd 8/1/2004 13:11'!close	"close the receiver"	isSleeping		ifTrue: [""			isSleeping := false.			^ self].	""	self isOpened		ifFalse: [^ self error: 'device not opened'].	""	[implementation close]		on: Error		do: [:exception | exception].	self class unregister: self! !!VideoDevice methodsFor: 'opening / closing' stamp: 'dgd 7/11/2004 20:48'!closeIfCorresponds	"close the receiver if it's opened, otherwise do nothing"	self isOpened		ifTrue: [self close]! !!VideoDevice methodsFor: 'opening / closing' stamp: 'dgd 7/28/2004 20:19'!isOpened	"answer whatever the receiver is opened"	^ implementation isOpened! !!VideoDevice methodsFor: 'opening / closing' stamp: 'dgd 8/10/2004 21:27'!open	"open the device represented by the receiver"	self isOpened		ifTrue: [^ self error: 'device already opened'].	""	[implementation open.	self class register: self.self triggerEvent: #extent.	isSleeping := false]		on: Error		do: [:exception | self bePoisoned]! !!VideoDevice methodsFor: 'opening / closing' stamp: 'dgd 7/11/2004 20:48'!openIfCorresponds	"open the receiver if it isn't opened, otherwise do nothing"	self isOpened		ifFalse: [self open]! !!VideoDevice methodsFor: 'configuration' stamp: 'dgd 8/10/2004 21:27'!applyParameters: aCollection 	"apply the (possible changed) collection of parameters"	self isPoisoned		ifFalse: [self close].	implementation applyParameters: aCollection.	self isPoisoned		ifFalse: [self open].! !!VideoDevice methodsFor: 'configuration' stamp: 'dgd 8/10/2004 14:59'!parameters	"answer a collection of parameters to configure the receiver"	^ implementation parameters! !!VideoDevice methodsFor: 'sleeping' stamp: 'dgd 8/1/2004 20:14'!awake	"if the receiver is sleeping, awake it"	isExecutor		ifTrue: [^ self].	""	isSleeping		ifFalse: [^ self].	""	self open.	isSleeping := false! !!VideoDevice methodsFor: 'sleeping' stamp: 'dgd 8/1/2004 13:11'!sleep	"if the receiver is opened, put it to sleep"	isExecutor		ifTrue: [^ self].	""	self isOpened		ifFalse: [^ self].	""	self close.	isSleeping := true! !!VideoDevice methodsFor: 'initialization' stamp: 'dgd 8/1/2004 17:58'!initialize	"initialize the receiver"	isSleeping := false.	isExecutor := false.	""	brightness := 0.0.	contrast := 0.0! !!VideoDevice methodsFor: 'initialization' stamp: 'dgd 8/9/2004 19:43'!initializeImplementation: anImplementor 	"initialize the receiver's description"	implementation := anImplementor.implementation when: #extent		send: #changedExtent		to: self! !!VideoDevice methodsFor: 'capturing' stamp: 'dgd 8/1/2004 20:47'!next	"answer the next frame from the device represented by the  	receiver"	self tryToReviveIfCorresponds.	""	self isPoisoned		ifTrue: [^ self poisonedFrame].	self isOpened		ifFalse: [^ self closedFrame].	""	[^ implementation nextWithBrightness: self brightness contrast: self contrast]		on: Error		do: [:exception | 			self bePoisoned.			^ self poisonedFrame]! !!VideoDevice methodsFor: 'finalization' stamp: 'dgd 8/1/2004 21:07'!actAsExecutor	"prepare the receiver to act as executor for any resources associated with it"	super actAsExecutor.	"an executor will not to go sleep becouse the original instance 	will close the device for its own"	isExecutor := true! !!VideoDevice methodsFor: 'finalization' stamp: 'dgd 7/11/2004 20:49'!finalize	"the receiver is going to die, let's clean up"		self closeIfCorresponds! !!VideoDevice class methodsFor: 'system startup' stamp: 'dgd 7/11/2004 20:46'!shutDown: quitting 	quitting ifFalse:[^self].""			self allSubInstances				do: [:each | each sleep]! !!VideoDevice class methodsFor: 'system startup' stamp: 'dgd 7/11/2004 20:46'!startUp: resuming 	resuming ifFalse:[^self].""					self allSubInstances				do: [:each | each awake]! !!VideoDevice class methodsFor: 'initialize-release' stamp: 'dgd 7/28/2004 21:14'!initialize	" 	VideoDevice initialize. 	"	Smalltalk addToStartUpList: self.	Smalltalk addToShutDownList: self! !!VideoDevice class methodsFor: 'initialize-release' stamp: 'dgd 7/28/2004 21:15'!unload	Smalltalk removeFromStartUpList: self.	Smalltalk removeFromShutDownList: self! !!VideoDevice class methodsFor: 'registry' stamp: 'dgd 7/11/2004 20:45'!register: anObject 	"register anObject to receive the finalization signal"	WeakArray isFinalizationSupported		ifFalse: [^ self].	self registry add: anObject! !!VideoDevice class methodsFor: 'registry' stamp: 'dgd 7/11/2004 20:45'!registry	"anwer the registry for finalization"	WeakArray isFinalizationSupported		ifFalse: [^ nil].	^ Registry		ifNil: [Registry := WeakRegistry new]! !!VideoDevice class methodsFor: 'registry' stamp: 'dgd 7/11/2004 20:45'!unregister: anObject 	WeakArray isFinalizationSupported		ifFalse: [^ self].	self registry		remove: anObject		ifAbsent: []! !!VideoDevice class methodsFor: 'instance creation' stamp: 'dgd 8/5/2004 19:19'!default	"answer the default video device"	" 	VideoDevice default.  	"	^ self implementation: self firstAvailableDeviceImplementor! !!VideoDevice class methodsFor: 'instance creation' stamp: 'dgd 11/3/2006 14:27'!firstAvailableDeviceImplementor	"private - answer the first available video device implementor"	| descriptions |	descriptions := self descriptions 						asSortedCollection: [:x :y | x id <= y id].	descriptions isEmpty ifTrue: [^self error: 'no video devices detected'].	descriptions do: [:eachDescription | 		[^ eachDescription newImplementor]			on: Error			do: [:exception | ]	].! !!VideoDevice class methodsFor: 'instance creation' stamp: 'dgd 7/28/2004 20:16'!implementation: anImplementor 	"answer an instance of the receiver using the given  	implementor"	^ self new initializeImplementation: anImplementor! !!VideoDevice class methodsFor: 'instance creation' stamp: 'dgd 7/28/2004 20:30'!new	"answer a new instance of the receiver"	^ super new initialize ! !!VideoDevice class methodsFor: 'enumerating' stamp: 'dgd 8/5/2004 19:30'!descriptions	"answer a collection of VideoDeviceDescription of available  	video devices"	" 	VideoDevice descriptions.  	"	| result |	result := Set new.	self workingImplementors		do: [:each | result addAll: each descriptions].	""	^ result ! !!VideoDevice class methodsFor: 'enumerating' stamp: 'dgd 8/5/2004 19:28'!workingImplementors	"private - answer a collection of implementors working on the 	current environment" 	^ VideoDeviceImplementor allSubclasses		select: [:each | each workOnCurrentEnvironment]! !!VideoDeviceImplementor methodsFor: 'configuration' stamp: 'dgd 8/10/2004 18:24'!applyParameters: aCollection 	"apply the (possible changed) collection of para