		copyQuad: lenna boundingBox innerCorners		toRect: (0 @ 0 extent: self extent).	""	^ result ! !!TestDeviceImplementor methodsFor: 'opening / closing' stamp: 'dgd 7/28/2004 17:34'!close	"private - close the receiver"	opened := false! !!TestDeviceImplementor methodsFor: 'opening / closing' stamp: 'dgd 7/28/2004 17:34'!isOpened	"answer whatever the receiver is opened"	^ opened! !!TestDeviceImplementor methodsFor: 'opening / closing' stamp: 'dgd 7/28/2004 17:34'!open	"open the device represented by the receiver"	opened := true! !!TestDeviceImplementor methodsFor: 'configuration' stamp: 'dgd 8/10/2004 21:18'!applyParameters: aCollection 	"apply the (possible changed) collection of parameters"	aCollection		do: [:parameter | 			parameter name == #extent				ifTrue: [self extent: parameter value].			parameter name == #type				ifTrue: [type := parameter value].			parameter name == #isShowingTime				ifTrue: [isShowingTime := parameter value]]! !!TestDeviceImplementor methodsFor: 'configuration' stamp: 'dgd 8/10/2004 20:16'!parameters	"answer a collection of parameters to configure the receiver"	| extentParameter showTimeParameter typeParameter |	extentParameter := ParameterDescription				extentParameterNamed: #extent				label: 'Frame extent' translated				value: extent				help: 'the frame extent in pixels' translated.	typeParameter := ParameterDescription				optionParameterNamed: #type				label: 'Type' translated				value: type				options: {{'Lenna'. #lenna}. {'Color Bars'. #colorBars}}				help: 'the type of the test image' translated.	showTimeParameter := ParameterDescription				booleanParameterNamed: #isShowingTime				label: 'show time' translated				value: isShowingTime				help: 'the test image includes the time' translated.	^ {extentParameter. typeParameter. showTimeParameter}! !!TestDeviceImplementor methodsFor: 'capturing' stamp: 'dgd 8/9/2004 21:14'!nextWithBrightness: brightnessFloat contrast: contrastFloat 	"answer the next frame from the device represented by the  	receiver"	| result |	result := type == #lenna 				ifTrue: [self scaledLenna]				ifFalse: [self colorBars].	""	isShowingTime 		ifTrue: 			[""			result getCanvas 				drawString: Time now print24				at: 5 @ 2				font: Preferences windowTitleFont				color: Color white].	""	^result! !!TestDeviceImplementor methodsFor: 'initialization' stamp: 'dgd 11/3/2006 15:02'!initialize	"initialize the receiver"	super initialize.	type := #lenna.	"type := #colorBars."	isShowingTime := true.	opened := true.	extent := 320 @ 240.! !!V4LDeviceImplementor methodsFor: 'printing' stamp: 'dgd 8/10/2004 20:53'!printOn: aStream 	"append to aStream a sequence of characters that identifies  	the receiver"	super printOn: aStream.	""	aStream		nextPutAll: ', deviceHandle=';		nextPutAll: deviceHandle asString;		nextPutAll: ', deviceID:';		nextPutAll: self deviceID asString! !!V4LDeviceImplementor methodsFor: 'opening / closing' stamp: 'dgd 8/6/2004 18:52'!close	"close the receiver"	| dh |	dh :=  deviceHandle.	""	deviceHandle := nil.	buffer := nil.	""	self deviceClose: dh! !!V4LDeviceImplementor methodsFor: 'opening / closing' stamp: 'dgd 8/6/2004 18:52'!isOpened	"answer whatever the receiver is opened"	^  deviceHandle notNil! !!V4LDeviceImplementor methodsFor: 'opening / closing' stamp: 'dgd 8/10/2004 20:53'!open	"open the device represented by the receiver"	| w h |	deviceHandle := self 				deviceCreate: deviceID				with: desiredExtent x				height: desiredExtent y				palette: desiredPalette.	""	w := self deviceGetWidth: deviceHandle.	h := self deviceGetHeight: deviceHandle.	""	buffer := Form extent: w @ h depth: 32! !!V4LDeviceImplementor methodsFor: 'primitives' stamp: 'dgd 7/28/2004 18:16'!deviceClose: deviceInteger 	<primitive: 'primitiveDeviceClose' module:'V4LPlugin'>	^ self error: 'can''t open device  ''' , deviceInteger asString , ''''! !!V4LDeviceImplementor methodsFor: 'primitives' stamp: 'dgd 8/5/2004 22:50'!deviceCreate: deviceIDInteger with: widthInteger height: heightInteger palette: paletteInteger 	<primitive: 'primitiveDeviceCreate' module:'V4LPlugin'>	^ self error: 'can''t create device id ''' , deviceIDInteger asString , ''''! !!V4LDeviceImplementor methodsFor: 'primitives' stamp: 'dgd 7/28/2004 18:17'!deviceGetHeight: deviceInteger 	<primitive: 'primitiveDeviceGetHeight' module:'V4LPlugin'>	^ self error: 'primitive failed for device  ''' , deviceInteger asString , ''''! !!V4LDeviceImplementor methodsFor: 'primitives' stamp: 'dgd 7/28/2004 18:17'!deviceGetWidth: deviceInteger 	<primitive: 'primitiveDeviceGetWidth' module:'V4LPlugin'>	^ self error: 'primitive failed for device  ''' , deviceInteger asString , ''''! !!V4LDeviceImplementor methodsFor: 'primitives' stamp: 'dgd 7/28/2004 18:16'!deviceNextFrame: deviceInteger into: bits brightness: brightnessFloat contrast: contrastFloat 	<primitive: 'primitiveDeviceNextFrameIntoBrightnessAndContrast' module:'V4LPlugin'>	^ self error: 'can''t capture frame in device  ''' , deviceInteger asString , ''''! !!V4LDeviceImplementor methodsFor: 'accessing' stamp: 'dgd 8/5/2004 22:49'!deviceID"answer the receiver's deviceID"	^ deviceID! !!V4LDeviceImplementor methodsFor: 'accessing' stamp: 'dgd 8/5/2004 22:49'!extent	"answer the receiver's extent"	^ buffer isNil		ifTrue: [320 @ 240]		ifFalse: [buffer extent]! !!V4LDeviceImplementor methodsFor: 'capturing' stamp: 'dgd 8/6/2004 18:52'!nextWithBrightness: brightnessFloat contrast: contrastFloat 	"answer the next frame from the device represented by the  	receiver"	buffer unhibernate.	self		deviceNextFrame:  deviceHandle		into: buffer bits		brightness: brightnessFloat		contrast: contrastFloat.	" 	self deviceNextFrame: self deviceHandle into: buffer bits.  	"	^ buffer deepCopy! !!V4LDeviceImplementor methodsFor: 'initialization' stamp: 'dgd 8/5/2004 22:19'!initializeDescription: aDescription 	"initialiaze the receiver's description"	super initializeDescription: aDescription.	""	self		initializeDevice: aDescription id		extent: self class defaultExtent		palette: self class defaultPalette		open: true! !!V4LDeviceImplementor methodsFor: 'initialization' stamp: 'dgd 8/10/2004 20:53'!initializeDevice: deviceIDInteger extent: aPoint palette: paletteInteger open: aBoolean 	"initialize the receiver"	deviceID := deviceIDInteger asInteger.	desiredExtent := aPoint asIntegerPoint.	desiredPalette := paletteInteger asInteger.	""	deviceHandle := nil.	buffer := nil.	""	aBoolean ifTrue: [self open]! !!V4LDeviceImplementor methodsFor: 'configuration' stamp: 'dgd 8/10/2004 21:26'!applyParameters: aCollection 	"apply the (possible changed) collection of parameters"	aCollection		do: [:parameter | 			parameter name == #extent				ifTrue: [					desiredExtent := parameter value.					].			parameter name == #palette				ifTrue: [desiredPalette := parameter value]]! !!V4LDeviceImplementor methodsFor: 'configuration' stamp: 'dgd 8/10/2004 21:21'!palettes	| palettes |	palettes := OrderedCollection new.	palettes add: {'DEFAULT - The palette the camera most like' translated. 0}.	"palettes add: {'GREY - Linear greyscale' translated. 1}."	"palettes add: {'HI240 - High 240 cube (BT848)' translated. 2}."	"palettes add: {'RGB565 - 565 16 bit RGB' translated. 3}."	palettes add: {'RGB24 - 24bit RGB' translated. 4}.	palettes add: {'RGB32 - 32bit RGB' translated. 5}.	"palettes add: {'RGB555 - 555 15bit RGB' translated. 6}."	"palettes add: {'YUV422 - YUV422 capture' translated. 7}."	"palettes add: {'YUYV' translated. 8}."	"palettes add: {'UYVY' translated. 9}."	palettes add: {'YUV420' translated. 10}.	"palettes add: {'YUV411 - YUV411 capture' translated. 11}."	"palettes add: {'RAW - RAW capture (BT848)' translated. 12}."	"palettes add: {'YUV422P - YUV 4:2:2 Planar' translated. 13}."	"palettes add: {'YUV411P - YUV 4:1:1 Planar' translated. 14}."	palettes add: {'YUV420P - YUV 4:2:0 Planar' translated. 15}.	"palettes add: {'YUV410P - YUV 4:1:0 Planar' translated. 16}."	^ palettes! !!V4LDeviceImplementor methodsFor: 'configuration' stamp: 'dgd 8/10/2004 21:07'!parameters	"answer a collection of parameters to configure the receiver"	| extentParameter paletteParameter |	extentParameter := ParameterDescription				extentParameterNamed: #extent				label: 'Frame extent' translated				value: desiredExtent				help: 'the frame extent in pixels' translated.	paletteParameter := ParameterDescription				optionParameterNamed: #palette				label: 'Palette' translated				value: desiredPalette				options: self palettes				help: 'the palette of the test image' translated.	^ {extentParameter. paletteParameter}! !!VideoDeviceImplementor class methodsFor: 'instance creation' stamp: 'dgd 7/28/2004 17:17'!new	"answer a new instance of the receiver"	^ super new initialize! !!VideoDeviceImplementor class methodsFor: 'instance creation' stamp: 'dgd 7/28/2004 20:21'!newFromDescription: aDescription 	"answer a new instance of the receiver represented by the  	given description"	^ self new initializeDescription: aDescription! !!VideoDeviceImplementor class methodsFor: 'testing' stamp: 'dgd 7/28/2004 17:16'!workOnCurrentEnvironment	"Answer whatever ther receiver can work on the current  	environment. 	 	Usually the platform name is used to decide"	^ self subclassResponsibility! !!VideoDeviceImplementor class methodsFor: 'enumerating' stamp: 'dgd 8/5/2004 19:26'!descriptions	"answer a collection of VideoDeviceDescription of available 	video devices"	^self subclassResponsibility! !!VideoDeviceImplementor class methodsFor: 'private' stamp: 'dgd 7/28/2004 18:42'!descriptionForId: anInteger name: aString 	"private - answer a description for the given id and name"	^ VideoDeviceImplementorDescription		type: self		id: anInteger		name: aString ! !!TestDeviceImplementor class methodsFor: 'enumerating' stamp: 'dgd 8/5/2004 19:26'!descriptions	"answer a collection of VideoDeviceDescription of available  	video devices"	^{ 		self descriptionForId: 10 name: 'Test Video Device'}! !!TestDeviceImplementor class methodsFor: 'testing' stamp: 'dgd 7/28/2004 17:34'!workOnCurrentEnvironment	"Answer whatever ther receiver can work on the current  	environment.  	 	Usually the platform name is used to decide"	"the test video device always works"	^ true! !!V4LDeviceImplementor class methodsFor: 'instance creation' stamp: 'dgd 7/28/2004 18:11'!defaulfDevice	"answer the default device for instances of the receiver"	^ 0! !!V4LDeviceImplementor class methodsFor: 'instance creation' stamp: 'dgd 7/28/2004 18:11'!defaultExtent	"answer the default extent for instances of the receiver"	^ 320 @ 240! !!V4LDeviceImplementor class methodsFor: 'instance creation' stamp: 'dgd 7/28/2004 18:11'!defaultPalette	"answer the default extent for instances of the receiver"	^ 0! !!V4LDeviceImplementor class methodsFor: 'instance creation' stamp: 'dgd 7/28/2004 18:11'!device: idInteger 	"answer an instance of the receiver"	" 	LinuxCamera device: '/dev/video'  	"	^ self device: idInteger extent: self defaultExtent! !!V4LDeviceImplementor class methodsFor: 'instance creation' stamp: 'dgd 8/5/2004 22:19'!device: idInteger extent: aPoint 	"answer an instance of the receiver"	^ self		device: idInteger		extent: aPoint		palette: self defaultPalette! !!V4LDeviceImplementor class methodsFor: 'instance creation' stamp: 'dgd 8/5/2004 22:20'!device: idInteger extent: aPoint palette: paletteInteger 	"answer an instance of the receiver"	^ self		device: idInteger		extent: aPoint		palette: paletteInteger		open: true! !!V4LDeviceImplementor class methodsFor: 'instance creation' stamp: 'dgd 8/5/2004 22:21'!device: idInteger extent: aPoint palette: paletteInteger open: aBoolean 	"answer an instance of the receiver"	"VIDEO_PALETTE_RGB24 = 4. --> depth=24"	"VIDEO_PALETTE_YUV420 = 10. --> depth=12"	^ super new		initializeDevice: idInteger		extent: aPoint		palette: paletteInteger		open: aBoolean! !!V4LDeviceImplementor class methodsFor: 'instance creation' stamp: 'dgd 8/5/2004 22:19'!extent: aPoint 	"answer an instance of the receiver"	^ self		extent: aPoint		palette: self defaultPalette! !!V4LDeviceImplementor class methodsFor: 'instance creation' stamp: 'dgd 8/5/2004 22:20'!extent: aPoint palette: paletteInteger 	"answer an instance of the receiver"	^ self		device: self defaulfDevice		extent: aPoint		palette: paletteInteger! !!V4LDeviceImplementor class methodsFor: 'instance creation' stamp: 'dgd 8/5/2004 22:20'!newOpen: aBoolean 	"answer an instance of the receiver"	^ self		device: self defaulfDevice		extent: self defaultExtent		palette: self defaultPalette		open: aBoolean! !!V4LDeviceImplementor class methodsFor: 'enumerating' stamp: 'dgd 7/28/2004 18:10'!descriptionForDeviceID: deviceID 	"answer the description for the device with the given ID"	| buffer deviceName |	buffer := ByteArray new: 32.	self deviceDescribe: deviceID in: buffer.	""	deviceName := buffer asString				reject: [:each | each asciiValue = 0].	""	^ deviceName! !!V4LDeviceImplementor class methodsFor: 'enumerating' stamp: 'dgd 8/5/2004 19:30'!descriptions	"answer a collection of VideoDeviceDescription of available  	video devices"	" 	V4LDeviceImplementor descriptions.  	 	Time millisecondsToRun:[  	V4LDeviceImplementor descriptions  	]  	"	| result |	result := Set new.	0		to: 9		do: [:deviceID | 			| deviceName | 			deviceName := self descriptionForDeviceID: deviceID.			deviceName isEmpty				ifFalse: [result						add: (self descriptionForId: deviceID name: deviceName)]].	^ result! !!V4LDeviceImplementor class methodsFor: 'enumerating' stamp: 'dgd 8/20/2006 12:33'!workOnCurrentEnvironment	"Answer whatever ther receiver can work on the current  	environment.  	 	Usually the platform name is used to decide"			((Smalltalk respondsTo: #osVersion) and: [Smalltalk osVersion = 'linux-gnu'])		ifTrue:[^ true].		Smalltalk		at:#SmalltalkImage		ifPresent:[:klass |			^ klass current osVersion = 'linux-gnu'		].		^ false.! !!V4LDeviceImplementor class methodsFor: 'primitives' stamp: 'dgd 11/3/2006 11:50'!deviceDescribe: deviceIDInteger in: deviceName 	<primitive: 'primitiveDeviceDescribe' module:'V4LPlugin'>	^ self error: 'can''t describe device id ''' , deviceIDInteger asString , ''''! !!VideoDeviceImplementorDescription methodsFor: 'comparing' stamp: 'dgd 7/26/2004 19:37'!hash	"Answer a SmallInteger whose value is related to the receiver's identity."	^ (self type hash bitXor: self id hash)		bitXor: self name hash! !!VideoDeviceImplementorDescription methodsFor: 'comparing' stamp: 'dgd 7/26/2004 19:35'!= aVideoDeviceDescription 	"answer whatever the receiver is equivalent to  	aVideoDeviceDescription"	^ self class = aVideoDeviceDescription class		and: [self type = aVideoDeviceDescription type]		and: [self id = aVideoDeviceDescription id]		and: [self name = aVideoDeviceDescription name] ! !!VideoDeviceImplementorDescription methodsFor: 'accessing' stamp: 'dgd 7/26/2004 19:15'!id	"answer the receiver's id"	^ id! !!VideoDeviceImplementorDescription methodsFor: 'accessing' stamp: 'dgd 7/26/2004 19:15'!name	"answer the receiver's name"	^ name! !!VideoDeviceImplementorDescription methodsFor: 'accessing' stamp: 'dgd 7/26/2004 19:16'!type	"answer the receiver's type"	^ type! !!VideoDeviceImplementorDescription methodsFor: 'printing' stamp: 'dgd 7/26/2004 19:15'!printOn: aStream 	"Append to aStream a sequence of characters that identifies 	the receiver."	super printOn: aStream.	""	aStream nextPutAll: ' name:';		 nextPutAll: self name asString;		 nextPutAll: ', id:';		 nextPutAll: self id asString;		 nextPutAll: ', type:';		 nextPutAll: self type asString! !!VideoDeviceImplementorDescription methodsFor: 'initialization' stamp: 'dgd 7/26/2004 19:08'!initializeType: aClass id: anInteger name: aString 	"initialize the receiver"	type := aClass.	id := anInteger.	name := aString ! !!VideoDeviceImplementorDescription methodsFor: 'factory' stamp: 'dgd 7/28/2004 18:44'!newImplementor	"answer the implementor instance represented by the receiver"	^ type newFromDescription: self! !!VideoDeviceImplementorDescription class methodsFor: 'instance creation' stamp: 'dgd 7/26/2004 19:08'!type: aClass id: anInteger name: aString	"answer a new instance of the receiver"	^ self new initializeType: aClass id: anInteger name: aString! !!VideoMorph methodsFor: 'meta-actions' stamp: 'dgd 8/6/2004 19:17'!openAPropertySheet	VideoPropertiesMorph basicNew targetMorph: self;		 initialize;		 openNearTarget! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 7/11/2004 21:36'!arrowDeltaFor: aGetSelector 	"Answer a number indicating the default arrow delta to be  	used in a numeric readout with the given get-selector. This is  	a hook that subclasses of Morph can reimplement."	(#(#getBrightness #getContrast ) includes: aGetSelector)		ifTrue: [^ 0.1].	^ super arrowDeltaFor: aGetSelector! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 7/11/2004 21:36'!defaultFloatPrecisionFor: aGetSelector 	"Answer a number indicating the default float precision to be  	used in a numeric readout for which the receiver provides the 	data. Individual morphs can override this. Showing fractional  	values for readouts of getCursor was in response to an explicit 	request from ack"	(#(#getBrightness #getContrast  ) includes: aGetSelector)		ifTrue: [^ 0.01].	""	^ super defaultFloatPrecisionFor: aGetSelector! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 8/9/2004 20:47'!forgetConfigurationDialogconfigurationDialog_nil! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 8/6/2004 19:56'!getAutoExtent	^ self autoExtent! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 7/3/2004 16:02'!getBrightness	^ videoSource isNil		ifTrue: [0]		ifFalse: [videoSource brightness]! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 7/3/2004 16:02'!getContrast	^ videoSource isNil		ifTrue: [0]		ifFalse: [videoSource contrast]! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 6/28/2004 11:35'!getIsRunning	^ videoSource notNil		and: [videoSource isOpened]! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 7/1/2004 18:34'!getLastFrame	videoSource isNil		ifTrue: [^ self presenter standardPlayer costume].	videoSource isOpened		ifFalse: [^ self presenter standardPlayer costume].	""	self updateForm.	^ SketchMorph withForm: form deepCopy! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 7/1/2004 13:23'!getResolution	^ resolution! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 6/28/2004 11:34'!play	videoSource isNil		ifFalse: [videoSource openIfCorresponds]! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 8/6/2004 19:57'!setAutoExtent: aBoolean 	self autoExtent: aBoolean! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 8/3/2004 13:35'!setBrightness: amt 	videoSource isNil		ifFalse:[videoSource brightness: amt]! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 8/3/2004 13:36'!setContrast: amt 	videoSource isNil		ifFalse:[videoSource contrast: amt]! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 7/1/2004 13:37'!setResolution: aSymbol 	| newResolution |	newResolution := aSymbol asSymbol.	resolution := (self class resolutions includes: newResolution)				ifTrue: [newResolution]				ifFalse: [self class resolutions first]! !!VideoMorph methodsFor: 'e-toy support' stamp: 'dgd 6/28/2004 11:33'!stop	videoSource isNil		ifFalse: [videoSource closeIfCorresponds]! !!VideoMorph methodsFor: 'submorphs-add/remove' stamp: 'dgd 8/9/2004 19:22'!delete	"Remove the receiver as a submorph of its owner and make its  	new owner be nil."	self videoSource: nil.	super delete.! !!VideoMorph methodsFor: 'initialization' stamp: 'dgd 8/9/2004 11:12'!initialize	"initialize the receiver"	super initialize.	autoExtent := true.	""	resolution := #original.	""	self extent: 320 @ 240.	self borderWidth: 0.	self updateForm! !!VideoMorph methodsFor: 'initialization' stamp: 'dgd 8/6/2004 19:45'!initializeOn: aVideoSource 	"initialize the receiver's videoSource"	self videoSource: aVideoSource.	self tryToAutoExtent! !!VideoMorph methodsFor: 'accessing' stamp: 'dgd 8/6/2004 19:47'!autoExtent	"answer the receiver's autoExtent"	^ autoExtent! !!VideoMorph methodsFor: 'accessing' stamp: 'dgd 8/6/2004 19:45'!autoExtent: aBoolean 	"change the receiver's autoExtent"	autoExtent := aBoolean.self tryToAutoExtent! !!VideoMorph methodsFor: 'accessing' stamp: 'dgd 8/6/2004 20:22'!borderWidth: anInteger 	super borderWidth: anInteger.	self tryToAutoExtent ! !!VideoMorph methodsFor: 'accessing' stamp: 'dgd 8/6/2004 20:02'!switchAutoExtent	^ self autoExtent: self autoExtent not! !!VideoMorph methodsFor: 'accessing' stamp: 'dgd 8/9/2004 19:45'!videoSource: aVideoSource 	"change the receiver's videoSource"	videoSource == aVideoSource		ifTrue: [^ self].	""	videoSource isNil		ifFalse: [""			videoSource removeActionsWithReceiver: self.			videoSource closeIfCorresponds].	""	videoSource := aVideoSource.	videoSource		when: #extent		send: #tryToAutoExtent		to: self ! !!VideoMorph methodsFor: 'private' stamp: 'dgd 6/28/2004 11:52'!freeAreaExtent"private - answer the extent to fill (or filled) with tha image"	^ self extent - (self borderWidth * 2)! !!VideoMorph methodsFor: 'private' stamp: 'dgd 8/9/2004 19:23'!scaledForm	"private - answer the form, but scaled to fit the morph"	| freeAreaExtent formExtent outForm warpBlt |	freeAreaExtent := self freeAreaExtent.	formExtent := form extent.	(freeAreaExtent = formExtent			or: [formExtent isZero])		ifTrue: [^ form].	""	outForm := Form extent: freeAreaExtent depth: form depth.	warpBlt := WarpBlt current toForm: outForm.	warpBlt sourceForm: form.	warpBlt cellSize: 2;		 combinationRule: Form over.	warpBlt		copyQuad: form boundingBox innerCorners		toRect: (0 @ 0 extent: freeAreaExtent).	""	^ outForm! !!VideoMorph methodsFor: 'private' stamp: 'dgd 8/9/2004 19:24'!tryToAutoExtent	"private - if corresponds, try to change the receiver's extent"	autoExtent		ifTrue: [self extent: 0 @ 0]! !!VideoMorph methodsFor: 'private' stamp: 'dgd 7/13/2004 20:28'!updateForm	"private - update the form from the videoSource"	videoSource isNil		ifTrue: [""			form := Form extent: 320 @ 240 depth: 32.			form fillColor: Color blue twiceDarker]		ifFalse: [""			form := videoSource next].	""	resolution == #'256 colors'		ifTrue: [form := form asFormOfDepth: 8].	resolution == #'256 grays'		ifTrue: [form := form asGrayScale].	resolution == #'4 grays'		ifTrue: [form := form asFormOfDepth: 2].	resolution == #'black and white'		ifTrue: [form := form asFormOfDepth: 1]! !!VideoMorph methodsFor: 'configuration' stamp: 'dgd 8/10/2004 18:15'!applyParameters: aCollection "apply the (possible changed) collection of parameters"	videoSource isNil		ifTrue: [^ self].	videoSource applyParameters: aCollection! !!VideoMorph methodsFor: 'configuration' stamp: 'dgd 8/9/2004 20:51'!bringUpConfigurationDialog	configurationDialog comeToFront.	configurationDialog topLeft: self topLeft + 5.	configurationDialog flash.! !!VideoMorph methodsFor: 'configuration' stamp: 'dgd 8/9/2004 20:50'!configureVideoDevice	"creates a dialog to configure the receiver's videoSource"	videoSource isNil		ifTrue: [^ self].	""	configurationDialog isNil		ifTrue: [self createConfigurationDialog]		ifFalse: [self bringUpConfigurationDialog] ! !!VideoMorph methodsFor: 'configuration' stamp: 'dgd 8/10/2004 14:59'!createConfigurationDialog	| parameters |	parameters := videoSource parameters.	parameters isEmpty		ifTrue: [^ self inform: 'the video device has not parameters to configure' translated].	""	configurationDialog := VideoMorphConfiguration target: self parameters: parameters.	self addMorphBack: configurationDialog.	configurationDialog topLeft: self topLeft + 5! !!VideoMorph methodsFor: 'stepping and presenter' stamp: 'dgd 7/11/2004 22:12'!step	"Do some periodic activity"	videoSource isNil		ifTrue: [^ self].		""	self updateForm.	self changed! !!VideoMorph methodsFor: 'stepping and presenter' stamp: 'dgd 8/1/2004 20:22'!stepTime	"Answer the desired time between steps in milliseconds"	^ 100! !!VideoMorph methodsFor: 'menus' stamp: 'dgd 8/9/2004 20:41'!addCustomMenuItems: aMenu hand: aHandMorph 	super addCustomMenuItems: aMenu hand: aHandMorph.	aMenu add: 'configure video device' translated action: #configureVideoDevice! !!VideoMorph methodsFor: 'halos and balloon help' stamp: 'dgd 8/6/2004 20:06'!okayToResizeEasily^ self autoExtent not! !!VideoMorph methodsFor: 'halos and balloon help' stamp: 'dgd 8/6/2004 20:09'!wantsHaloHandleWithSelector: aSelector inHalo: aHaloMorph 	aSelector == #addDupHandle:		ifTrue: [^ false].	^ super wantsHaloHandleWithSelector: aSelector inHalo: aHaloMorph ! !!VideoMorph methodsFor: 'drawing' stamp: 'dgd 7/3/2004 16:13'!drawOn: aCanvas 	"draw the receiver on aCanvas"	super drawOn: aCanvas.""	aCanvas paintImage: self scaledForm at: bounds origin + self borderWidth! !!VideoMorph methodsFor: 'geometry' stamp: 'dgd 8/6/2004 19:43'!extent: aPoint 	| newExtent |	newExtent := autoExtent				ifTrue: [videoSource isNil						ifTrue: [320 @ 240]						ifFalse: [videoSource extent + (self borderWidth * 2)]]				ifFalse: [aPoint].	""	super extent: newExtent ! !!VideoMorph class methodsFor: 'parts bin' stamp: 'dgd 7/28/2004 21:02'!descriptionForPartsBin	^ self		partName: 'Video Device'		categories: #('Multimedia' )		documentation: 'A player for video devices like cameras, video capturers, etc.'! !!VideoMorph class methodsFor: 'parts bin' stamp: 'dgd 7/28/2004 21:02'!newStandAlone	^ self		on: (VideoDevice default)! !!VideoMorph class methodsFor: 'misc' stamp: 'dgd 7/13/2004 20:28'!resolutions	"answer a collection of valid resolutions"	^ #(#original #'256 colors' #'256 grays' #'4 grays' #'black and white' )! !!VideoMorph class methodsFor: 'instance creation' stamp: 'dgd 6/4/2003 20:49'!on: aVideoSource 	"answer an instance of the receiver on aVideoSource"	^ super new initializeOn: aVideoSource! !!VideoMorph class methodsFor: 'scripting' stamp: 'dgd 8/20/2006 11:11'!additionsToViewerCategories	"Answer a list of (<categoryName> <list of category specs>) pairs that characterize the phrases this kind of morph wishes to add to various Viewer categories."	^ #(	(graphics		(			(slot graphic 	'The picture currently being worn' Graphic	 readOnly Player getGraphic unused unused)		)	)	(video		(			(command play 'Start playing the movie/sound')			(command stop 'Stop playing the movie/sound')			(slot isRunning 'Whether the movie/sound is being played' Boolean readOnly	Player getIsRunning unused unused)			(slot autoExtent 'Whether the morph is in auto-extent mode' Boolean readWrite	Player getAutoExtent Player setAutoExtent:)			(slot lastFrame 'A morph with the last frame' Player readOnly	Player getLastFrame unused unused)			(slot resolution 'Video resolution' ImageResolution readWrite Player getResolution Player setResolution:)			(slot brightness 'Video brightness' Number readWrite	Player getBrightness Player setBrightness:)			(slot contrast 'Video contrast' Number readWrite	Player getContrast Player setContrast:)			(command configureVideoDevice 'Open a dialog to configure the video device')		)	))! !!VideoMorph class methodsFor: 'class initialization' stamp: 'dgd 11/3/2006 15:18'!initialize	"	VideoMorph initialize.	"	| morph |	morph := self on: (VideoDevice implementation: TestDeviceImplementor new).	morph updateForm.	PartsBin		cacheThumbnail: (Thumbnail new makeThumbnailFromForm: morph imageForm)		forSymbol: 'Video Device'.! !!VideoMorphConfiguration methodsFor: 'building' stamp: 'dgd 8/10/2004 20:13'!build	self		addMorphBack: (StringMorph contents: 'Video Device Configuration' translated font: Preferences windowTitleFont).	""	self addMorphBack: self spacer.	parameters		do: [:each | self addMorphBack: each  asMorph].	self addMorphBack: self spacer.	""	self addMorphBack: self buttonsRow! !!VideoMorphConfiguration methodsFor: 'building' stamp: 'dgd 8/10/2004 14:12'!buttonsRow	"private - create a row with accept/cancel buttons"	| acept cancel |	acept := self				buttonNamed: 'Accept' translated				action: #doAccept				color: Color green darker				help: 'keep changes made and close panel' translated.	cancel := self				buttonNamed: 'Cancel' translated				action: #doCancel				color: Color red darker				help: 'cancel changes made and close panel' translated.	^ (self inARow: {acept. cancel})		! !!VideoMorphConfiguration methodsFor: 'building' stamp: 'dgd 8/10/2004 21:18'!doAccept| changes |changes := parameters				select: [:each | each hasChanged].changes isEmpty ifFalse:[	target applyParameters: changes].	self delete! !!VideoMorphConfiguration methodsFor: 'building' stamp: 'dgd 8/9/2004 17:11'!doCancel	self delete! !!VideoMorphConfiguration methodsFor: 'initialization' stamp: 'dgd 8/10/2004 14:05'!initialize	super initialize.	""	self		color: (Color lightYellow alpha: 0.9).	self borderColor: self color muchDarker.	self listDirection: #topToBottom.	self borderWidth: 4.	self layoutInset: 5.	self cellInset: 2.	self hResizing: #shrinkWrap.	self vResizing: #shrinkWrap.	self useRoundedCorners! !!VideoMorphConfiguration methodsFor: 'initialization' stamp: 'dgd 8/9/2004 20:47'!initializeTarget: aVideoMorph parameters: aCollection 	"initialize the receiver's parameters"target _ aVideoMorph.	parameters := aCollection.	self build! !!VideoMorphConfiguration methodsFor: 'private' stamp: 'dgd 8/10/2004 12:33'!buttonNamed: aString action: aSymbol color: aColor help: helpString 	"private - answer a new button"	| button |	button := SimpleButtonMorph new.	button target: self.	button label: aString.	button color: aColor.	button borderColor: aColor muchDarker.	button actionSelector: aSymbol.helpString isEmpty ifFalse:[	button setBalloonText: helpString].	^ button! !!VideoMorphConfiguration methodsFor: 'private' stamp: 'dgd 8/9/2004 20:04'!inARow: aCollectionOfMorphs 	"private - create a row of morphs"	| row |	row := AlignmentMorph newRow.	row color: Color transparent;		 vResizing: #shrinkWrap;		 layoutInset: 2;		 wrapCentering: #center;		 cellPositioning: #leftCenter;		 cellInset: 2.	aCollectionOfMorphs		do: [:each | row addMorphBack: each].	^ row! !!VideoMorphConfiguration methodsFor: 'private' stamp: 'dgd 8/9/2004 20:35'!spacer	^StringMorph contents: ' '! !!VideoMorphConfiguration methodsFor: 'submorphs-add/remove' stamp: 'dgd 8/9/2004 20:48'!delete	target forgetConfigurationDialog.super delete.! !!VideoMorphConfiguration class methodsFor: 'instance creation' stamp: 'dgd 8/9/2004 20:46'!target: aVideoMorph parameters: aCollection 	"answer a new instance of the receiver"	^ self new initializeTarget: aVideoMorph parameters: aCollection! !!VideoPropertiesMorph methodsFor: 'actions' stamp: 'dgd 8/6/2004 20:37'!brightness	"answer the receiver's brightness"	^ myTarget getBrightness! !!VideoPropertiesMorph methodsFor: 'actions' stamp: 'dgd 8/6/2004 20:41'!brightnessTitle	^ '  Brightness ({1}%)' translated format: {(self brightness * 100.0) rounded}! !!VideoPropertiesMorph methodsFor: 'actions' stamp: 'dgd 8/6/2004 20:43'!brightness: aNumber	"answer the receiver's brightness"	^ myTarget setBrightness: aNumber! !!VideoPropertiesMorph methodsFor: 'actions' stamp: 'dgd 8/6/2004 20:37'!contrast	"answer the receiver's contrast"	^ myTarget getContrast! !!