7766652 1188439436 65537 65536 0 0 0 0 0 65537 65537 65537 65537 65537 0 0 0 0 65537 0 0 65537 65537 65537 0 0 65537 0 1 65537 0 0 0 0 0 0 0 65537 65536 1 65536 0 0 0 65537 0 0 0 1 65536 0 0 0 0 0 65537 0 0 0 0 0 )		offset: 0 @ 0! !!VideoPropertiesMorph methodsFor: 'building' stamp: 'dgd 8/7/2004 20:48'!contrastIcon	^ Form		extent: 16 @ 16		depth: 16		fromArray: #(0 0 1 65537 65537 65536 0 0 0 1 65537 65537 65537 65537 65536 0 0 65537 77229 1324901277 835659116 348520449 65537 0 1 68708 1392011231 1742694334 837825007 837756268 69271553 65536 1 86776 1742695391 1742694367 837825007 837759471 627834881 65536 65537 766339039 1809804255 1809803231 837825007 837759471 768545990 65537 65537 1324902367 1742695391 1742694367 837825007 837759471 768550251 65537 65537 1671260094 1742694367 1742694334 837825007 837759471 768552398 65537 65537 1604150206 1740531646 1740530622 837759471 837758415 768552398 65537 65537 1324901310 1673421758 1673421758 837759471 837758415 768549227 65537 65537 699228094 1606312894 1606311870 837759471 768552399 768480454 65537 1 84695 1604149149 1604149149 768552399 768552398 560660481 65536 1 67683 1255627677 1537039261 768552399 768483691 69271553 65536 0 65537 76173 1188517756 768483691 348520449 65537 0 0 1 65537 65537 65537 65537 65536 0 0 0 1 65537 65537 65536 0 0 )		offset: 0 @ 0! !!VideoPropertiesMorph methodsFor: 'building' stamp: 'dgd 8/6/2004 20:19'!paneForAutoExtentToggle	^self inARow: {		self			directToggleButtonFor: myTarget 			getter: #autoExtent setter: #switchAutoExtent			help: 'Turn auto-extent on or off' translated.		self lockedString: ' Auto Extent' translated.	}! !!VideoPropertiesMorph methodsFor: 'building' stamp: 'dgd 8/8/2004 20:04'!paneForVideoParameters	| resolutionCombo brightnessSlider contrastSlider configureButton button |	brightnessSlider := self				buildSlider: #brightnessTitle				selector: #brightness				help: 'Drag in here to change the Brightness'				icon: self brightnessIcon.	contrastSlider := self				buildSlider: #contrastTitle				selector: #contrast				help: 'Drag in here to change the Contrast'				icon: self contrastIcon.	resolutionCombo := self				createComboLabel: 'resolution'				target: self				readSelector: #resolution				writeSelector: #resolution:				options: VideoMorph resolutions.	configureButton := self				buttonNamed: 'Configure Video Device' translated				action: #doConfigureVideoDevice				color: color lighter				help: 'press here to configure the video device' translated.	button := configureButton submorphs anyOne.	button borderWidth: 2;		 borderRaised;		 extent: button extent + 6.	""	^ (self inAColumn: {brightnessSlider. contrastSlider. resolutionCombo. configureButton}) cellPositioning: #topLeft;		 layoutInset: 0;		 cellInset: 2! !!VideoPropertiesMorph methodsFor: 'building' stamp: 'dgd 8/7/2004 21:39'!rebuild	self removeAllMorphs.	self addARow: {self			lockedString: ('Properties for {1}' translated format: {myTarget externalName})}.	self addARow: {self inAColumn: {self paneForCornerRoundingToggle. self paneForStickinessToggle. self paneForLockedToggle. self paneForAutoExtentToggle}}.	self addARow: {self paneForVideoParameters}.	self addARow: {self paneForBorderColorPicker. self paneForShadowColorPicker}.	self addARow: {self			buttonNamed: 'Accept' translated			action: #doAccept			color: color lighter			help: 'keep changes made and close panel' translated. self			buttonNamed: 'Cancel' translated			action: #doCancel			color: color lighter			help: 'cancel changes made and close panel' translated}.	thingsToRevert := Dictionary new.	thingsToRevert at: #hasDropShadow: put: myTarget hasDropShadow.	thingsToRevert at: #shadowColor: put: myTarget shadowColor.	thingsToRevert at: #borderColor: put: myTarget borderColor.	thingsToRevert at: #borderWidth: put: myTarget borderWidth.	thingsToRevert at: #cornerStyle: put: myTarget cornerStyle.	thingsToRevert at: #sticky: put: myTarget isSticky.	thingsToRevert at: #lock: put: myTarget isLocked.	thingsToRevert at: #autoExtent: put: myTarget autoExtent.	thingsToRevert at: #setContrast: put: myTarget getContrast.	thingsToRevert at: #setBrightness: put: myTarget getBrightness.	thingsToRevert at: #setResolution: put: myTarget getResolution! !!VideoPropertiesMorph methodsFor: 'widget creation' stamp: 'dgd 8/10/2004 12:34'!buildSlider: nameStringOrSymbol selector: aSymbol help: helpString icon: aForm 	| title slider icon titleRow col |	title := (nameStringOrSymbol isKindOf: Symbol)				ifTrue: [UpdatingStringMorph new useStringFormat; getSelector: nameStringOrSymbol; target: self; growable: true; minimumWidth: 24; lock]				ifFalse: [self lockedString: nameStringOrSymbol].	""	slider := SimpleSliderMorph new color: self color twiceDarker darker;				 extent: 370 @ 2;				 target: self;				 actionSelector: (aSymbol , ':') asSymbol;				 minVal: -1.0;				 maxVal: 1.0;				 yourself.	slider		adjustToValue: (self perform: aSymbol).	""	icon := ImageMorph new image: aForm.	titleRow := self inARow: {icon. title}.	titleRow hResizing: #shrinkWrap;		 cellInset: 3.	col := self inAColumn: {titleRow. slider}.	""	col borderWidth: 1;		 borderColor: color darker;		 color: color lighter;		 hResizing: #shrinkWrap;		 layoutInset: 5;		 cellInset: 5;		 useRoundedCorners.helpString isEmpty ifFalse:[col 		 setBalloonText: helpString.].	""	^ col! !!VideoPropertiesMorph methodsFor: 'widget creation' stamp: 'dgd 8/6/2004 22:15'!createComboLabel: aString target: targetObject readSelector: readSelectorSymbol writeSelector: writeSelectorSymbol options: optionsArray 	"private - create a combo"	| button row |	button := SimpleButtonMorph newWithLabel: '-'.	self		updateButton: button		for: targetObject		readSelector: readSelectorSymbol		options: optionsArray.	button borderWidth: 1;		 cornerStyle: #square;		 borderColor: #inset;		 color: self color darker.	button target: self;		 actionSelector: #popUpComboTarget:readSelector:writeSelector:options:button:;		 arguments: {targetObject. readSelectorSymbol. writeSelectorSymbol. optionsArray. button}.	""	row := AlignmentMorph newRow.	row borderWidth: 1;		 borderColor: color darker;		 color: color lighter;		 hResizing: #shrinkWrap;		 layoutInset: 5;		 cellInset: 5;		 useRoundedCorners.	row		addMorphBack: (StringMorph contents: aString , ': ').	row addMorphBack: button.	^ row! !!VideoPropertiesMorph methodsFor: 'widget creation' stamp: 'dgd 8/10/2004 12:25'!getLabelFor: targetObject readSelector: readSelectorSymbol options: optionsArray 	| currentValue |	currentValue := targetObject perform: readSelectorSymbol.	^ (optionsArray includes: currentValue)		ifTrue: [currentValue]		ifFalse: [^ '<unknown option>' translated]! !!VideoPropertiesMorph methodsFor: 'widget creation' stamp: 'dgd 8/6/2004 21:29'!performComboOption: writeSelectorSymbol argument: argumentObject readSelector: readSelectorSymbol target: targetObject button: button options: optionsArray 	targetObject perform: writeSelectorSymbol with: argumentObject.	""	self		updateButton: button		for: targetObject		readSelector: readSelectorSymbol		options: optionsArray! !!VideoPropertiesMorph methodsFor: 'widget creation' stamp: 'dgd 8/6/2004 22:11'!popUpComboTarget: targetObject readSelector: readSelectorSymbol writeSelector: writeSelectorSymbol options: optionsArray button: button 	| menu |	menu := MenuMorph new.	menu color: self color twiceLighter.	optionsArray		do: [:option | ""			menu				add: option 				target: self				selector: #performComboOption:argument:readSelector:target:button:options:				argumentList: {writeSelectorSymbol. option . readSelectorSymbol. targetObject. button. optionsArray}].	menu popUpInWorld! !!VideoPropertiesMorph methodsFor: 'widget creation' stamp: 'dgd 8/6/2004 22:14'!updateButton: button for: targetObject readSelector: readSelectorSymbol options: optionsArray 	| label |	label := self				getLabelFor: targetObject				readSelector: readSelectorSymbol				options: optionsArray.	button label: '  ',label,'  '! !!VideoPropertiesMorph methodsFor: 'initialization' stamp: 'dgd 8/6/2004 21:37'!initialize	"initialize the receiver"	super initialize.	""	myTarget isNil		ifTrue: [myTarget := RectangleMorph new openInWorld].	self		color: (Color				r: 0.476				g: 0.575				b: 0.869).	self borderColor: self color darker.	self rebuild ! !VideoMorph initialize!VideoDevice initialize!ImageResolutionType initialize!"Postscript:"PartsBin	cacheThumbnail: (Thumbnail new makeThumbnailFromForm: (VideoMorph on: (VideoDevice implementation: TestDeviceImplementor new) ) updateForm imageForm)	forSymbol: 'Video Device'.!